import React from 'react';

export const FilmList = ({ nameList }) => {
  return (
    <div className="text-yellow-500 font-bold">
      <h1>{nameList.name}</h1>
      <li>
        {nameList.films.forEach(item => (
          <li>{item}</li>
        ))}
      </li>
    </div>
  );
};
